import { useEffect, useState } from 'react';
import { ScrollView, View } from 'react-native';
import { Appbar, withTheme } from 'react-native-paper';
import Timeline from 'react-native-timeline-flatlist'

export default function PreTestScreen({ navigation, theme }) {
	const [data, setData] = useState();
	console.log('color : ', theme);

	useEffect(() => {
		setData([
			{ title: 'Materi Belajar', dotColor: 'green', circleColor: 'green' },
			{ title: 'Post Test', dotColor: 'green', circleColor: 'green' },
		]);
	}, [])



	return (
		<>
			<Appbar.Header>
				<Appbar.BackAction onPress={() => navigation.goBack()} />
				<Appbar.Content title="Akademi Bank Sampah" />
			</Appbar.Header>

			<Timeline
				data={data}
				showTime={false}
				innerCircle='dot'
				lineColor={'rgb(45,156,219)'}
			/>
		</>
	);
}
